import { combineReducers } from 'redux';
import AddUser from './reducer_add-user';
import AddFromFetch from './reducer_store-user'

const rootReducer = combineReducers ({
    addUser: AddUser,
    addFromFetch: AddFromFetch
});

export default rootReducer;
